css:
@-moz-document url-prefix("https://p5js.org") {
/** Made by ZpeedTube **/
body {
    background-color: #222;
    color: #ddd
}

#search_field {
    background-color: #8e8e8e!important;    
}

#search input[type=text]:focus {
    color: #14334a;
    outline-color: #0069b9;
    outline-width: 3px;
    outline-style: solid;
    border-radius: 2px;
}

#family {
    background-color: #111
}


a:link, a:visited {
    color: #6bc0ff;
    text-decoration: none;
}

.example_container {
    border-top: .09em dashed #959595;
    padding-top: .5em;
    margin-top: 1em;
}

pre[class*=language-] {
    border-left: .5em solid #555;
    background-color: #151515;
}
code[class*=language-], pre[class*=language-], textarea {
    color: #fff;
}
#exampleEditor {
    background-color: #333;
    color: #ddd;
}

/* Functions */
.token.attr-name, .token.builtin, .token.function, .token.selector, .token.string {
    color: #00c3ff;
}
.ace_function, .ace_keyword, .ace_support {
    color: #cedb00!important;
}
.ace_identifier{    
    color: #00c3ff;
}
/* function */
.ace_attribute-name, .ace_class, .ace_type {
    color:#1c9bff!important;
}
/* Values */
.token.boolean, .token.constant, .token.function-name, .token.number, .token.property, .token.symbol, .token.tag {
    color: #ff00a6;
}

/* operators */
.token.entity, .token.operator, .token.url, .token.variable {
    color: #ca9766;
    background: hsla(0, 0%, 100%, 0);
}

/* comments */
.token.block-comment, .token.cdata, .token.comment, .token.doctype, .token.prolog {
    color: #70d900;
}
.ace_comment {
    color: #70d900!important;
}

/* let */
.ace_editor {
    color: #d2b53e;
}
.token.atrule, .token.attr-value, .token.class-name, .token.keyword {
    color: #d2b53e;
}

/** Made by ZpeedTube **/
}
